import './App.css';

import Navbar from './components/navbar/Navbar'

import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import 'react-toastify/dist/ReactToastify.css';

function App() {
  return (
    <Router>
    <Navbar/>
      <Routes>
      <Route exact path="/" element={user?<Home/>:<Register/>} />
      <Route exact path="/login" element={user?<Navigate to="/"/>:<Login/>} />
      <Route exact path="/register" element={user?<Navigate to="/"/>: <Register/>} />
      <Route exact path="/user/booking" element={user?<Booking/>:<Login/>} />
      <Route exact path="/user/bookings" element={user?<Bookings/>:<Login/>} />
      <Route exact path="/driver/booking-request" element={user?(user.role==="ROLE_DRIVER"?<BookingRequests/>:<Bookings/>):<Login/>} />
      <Route exact path="/driver/routes" element={user?(user.role==="ROLE_DRIVER"?<Booking/>:<Bookings/>):<Login/>} />
      <Route  path ="*" element={<Notfound/>} />
    </Routes>
    </Router>
  )
}

export default App;
